import { useState, useEffect } from "react";
import "./App.css";
function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db.advisorProfileCollection.items);
      });
  }, []);
  console.log(data);
  return (
    <>
      {data.length > 0 &&
        data.map((item) => (
          <>
            <div>{item.displayName}</div>
            <img src={item.avatarUrl.avatarUrl} />
          </>
        ))}
    </>
  );
}

export default App;
